import './App.css';
import{BrowserRouter , Route , Switch} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Switch>
          <Route exact path='/' co />
        </Switch>
        <h1>Henry Countries</h1>
      </div>
    </BrowserRouter>
  );
}

export default App;
